sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
  var req = inputs.requestObject;
  req.annualPremium=calculateAnnualPremium(req.input_frequency, req.premium);

  var mul=req.multiplier||10;
  if(!req.sumAssured && inputs.insurer!="HDFC" && req.productId=="363f0ffb5f804d2bac044f931d9bf41a")
   req.sumAssured=req.annualPremium *parseInt(mul) +"";
   req.input_pptOption=inputs.pptOption;

if( req.variantId=="VRN003" || req.variantId=="VRN004"){
  if(req.sumAssured===0.0){
    var sum=req.annualPremium * 10;
    req.sumAssured=sum.toString().split(".")[0];
  }
}
//nearest Match for ICICI 
   if( inputs.insurer == "ICICI" && req.productId=="5fd6398fe76f4bd783aa96a54dafc8a1" && req.productId=="VRN006"){
   if(inputs.pptOption== "Limited Pay"){
    if(parseInt(req.age) + parseInt(req.pt) <= 75 ){
      var pt=(75 - parseInt(req.age)) +"";
      req.policyTerm = pt.split(".")[0];
    }
   }
   }
  outputs.requestbody= req;

  //gs.info("Freq: {0}, Premium: {1}", req.input_frequency, req.premium);
  function calculateAnnualPremium(freq, premium) {
     // gs.info("Freq: {0}, Premium: {1}", freq, premium);

      switch(freq) {
        case "PF003": return parseInt(premium);
        case "PF001": return 12 * parseInt(premium); 
        case "PF002": return 2 * parseInt(premium); 
        case "PF004": return 4 * parseInt(premium); 
        default: return 0;
      }
  }
})(inputs, outputs);

