sys_variable_value.value:
(function execute(inputs, outputs) {

    function calculateAge(dob) {
  var convertedDate=dob.split("/").reverse().join("/"); // output: 2022/07/24
return  new x_rptp_smartinte_0.moment().diff(convertedDate, 'years');
}

    var req;
    if (!typeof inputs.request == 'object') {
        req = JSON.parse(inputs.request);
    } else {
        req = inputs.request;
    }
    req.age=calculateAge(req.dob);
    var array = req.funds;
   // gs.info(JSON.stringify(array)); 
    outputs.response = req;
    outputs.isnri= req.isNri  ||""; // adding default value since isNri is not mandatory input.
    outputs.is_existing_user= req.isExistingCustomer;
    outputs.proposerGender= req.proposerGender ||"";
    outputs.ip = req.isPolicyHolder;
    outputs.fre = req.paymentFrequency;
    outputs.gen = req.gender;
    outputs.occ = req.occupation;
    outputs.marital = req.maritalStatus;
    outputs.gst_waiver=req.gstWaiver;

    //outputs.pro = req.proposalType;
    //outputs.strat = req.product.investmentProtifolio;


    if (req.pt===req.ppt){
    outputs.ppt = "Regular Pay";
    }
    else{
            outputs.ppt = "Limited Pay";      
    }
      if(req.variantId=="VRN006"){
            if(parseInt(req.age)+parseInt(req.pt) == 99){
            outputs.ppt="Whole Life"
        }
        else{
            outputs.ppt = "Limited Pay"; 
        }
        }

    var funds = [];

   if(!array)
   return
//gs.info("hello")

    array.forEach(function(rec) {
        var iGr = new GlideRecord("x_rptp_smartinte_0_integrationinsurer");
        iGr.addQuery("code", inputs.insurer);
        iGr.query();
        if (iGr.next()) {
            var oGr = new GlideRecord("x_rptp_smartinte_0_integrationoptiondatatypemaster");
            oGr.addQuery("option", rec.name);
            oGr.query();
            if (oGr.next()) {
                var gr = new GlideRecord('x_rptp_smartinte_0_integration_option_mapper');
                gr.addQuery("insurer", iGr.sys_id);
                gr.addQuery("option", oGr.sys_id);
                gr.query();

                if (gr.next()) {
                    var name = gr.getValue('value'); 
                    rec.name = name;
                    rec.name_cd="";
                    if (inputs.insurer == "HDFC") { 
                        var nameCode = name.toUpperCase().replace(/ /g, '_'); 
                        rec.name_cd = nameCode;
                    }
                    funds.push(rec);
                }
            }
        }
    });


   // gs.info(JSON.stringify(funds));

    outputs.funds = array||funds;
    // outputs.funds = JSON.stringify(funds);

})(inputs, outputs);

