sys_variable_value.value:
(function execute(inputs, outputs) {

// ... code ...
  var req=inputs.req;

if(req.isPolicyHolder!=""){
  if(inputs.insurer=="HDFC"){
    if(req.proposerGender=="G001"){
      req.proposerGender="M";
    }
    else{
      req.proposerGender="F";
    }
  }
  if(inputs.insurer=="BALIC"){
    if(req.proposerGender=="G001"){
      req.proposerGender="M";
    }
    else{
      req.proposerGender="F";
    }
  }
  if(inputs.insurer=="ICICI"){
    if(req.proposerGender=="G001"){
      req.proposerGender="Male";
    }
    else{
      req.proposerGender="Female";
    }
  }
}

if(!req.gstWaiver){
  req.gstWaiver="false"
}

  req.isPolicyHolder=inputs.ip;
  req.input_frequency = req.paymentFrequency;
  req.paymentFrequency=inputs.frequency;
 // req.proposalType=inputs.proposal;
  req.gender=inputs.gender;
  req.isExCustomer=inputs.isexisting;
  req.occupation=inputs.occ;
  req.maritalStatus=inputs.marital;
  //req.product.investmentProtifolio=inputs.investmentProtifolio;
  req.pptOption=inputs.ppt;
  req.funds=inputs.funds;
  req.annualPremium=calculateAnnualPremium(req.input_frequency,req.premium);
 req.age=calculateAge(req.dob);


///icici for tobbaco flag
if(req.smokerFlag && req.smokerFlag=="true"){
  req.smokerFlag="1";
}else{
  req.smokerFlag="0";

}



//for gst waiver and is nri
if(inputs.insurer=="BALIC"){
  if(req.isNri=="true"){
      req.isNri=inputs.gst_waiver;
  }
  else{
      req.isNri=inputs.isnri;
  }

}else{
  req.isNri=inputs.isnri;
 req.gstWaiver=inputs.gst_waiver;
}



if(req.proposerDob){
  req.proposerAge=calculateAge(req.proposerDob);
}



  outputs.requestbody=req;


})(inputs, outputs);

 function calculateAge(dob) {
  var convertedDate=dob.split("/").reverse().join("/"); // output: 2022/07/24
return  (new x_rptp_smartinte_0.moment().diff(convertedDate, 'years')).toString().split(".")[0];
}

function calculateAnnualPremium(freq, premium){

  switch(freq) {
    case "PF003": return parseInt(premium);
    case "PF001": return 12 * parseInt(premium); 
    case "PF002": return 2 * parseInt(premium); 
    case "PF004": return 4 * parseInt(premium); 
    default: return 0;
  }
  // if(freq=="PF003"){
  //   return ( 1 * parseInt(premium));
  // }
  // else if(freq=="PF001"){
  //   return 12 * parseInt(premium);
  // }
  // else if(freq="PF002"){
  //   return (2* parseInt(premium));

  // }
  // else if(freq="PF004"){
  //   return (4* parseInt(premium));

  // }
}

